 időszak eredményei megerősítettek abban a tényben, hogy egy letisztult, ám egyszerű, gyors, informatív irányvonalat követve mégis hatalmas sikereket lehet nem csak célirányosan kitűzni, de el is lehet érni.', 'szabaduszok-hoksza-mihaly-pic.jpg', 'szabaduszok-hoksza-mihaly-pic-list.jpg', null, '0', null, '2016-11-10 08:59:00', '2016-11-10 09:11:00', '0', '0', '0.00', '1', '0', 'Hoksza Mihály 6.éve foglalkozom honlapkészítéssel szabadúszóként. Számos letisztult, modern megjelenésű weboldalt készítettem a közelmúltban. Egy tucat nemzetközi domain, hazai domain, referencia munkával rendelkezem. Kizárólag statikus Bootstrap reszponzív HTML5 honlap keretrendszert, vagy mint a jelen esetben a 2016-os év legújabb technikáját az Accelerated Mobile Pages (AMP) keretrendszert használom, egyedi tervezésben. Európában jelenleg egyedüli AMP technológiai \"anya\" weboldallal rendelkezem. Az anya honlap heteken belül hatalmas Google sikereket ért el úgy, hogy a Google eszköz tárának majd 90% át használva, jelenleg is aktívan futtatom. Magyar viszonylatban a honlap rendelkezik olyan komplex aktív eszköztárral, amelyet a Google csapata állított össze felhasználásra,így ezen eszközök arzenálja található meg a honlap struktúráiban. A tesztelési időszak eredményei megerősítettek abban a tényben, hogy egy letisztult, ám egyszerű, gyors, informatív irányvonalat követve mégis hatalmas sikereket lehet nem csak célirányosan kitűzni, de el is lehet érni. 2016-11-10 Hernád  InformatikaMarketing,  bootstraphtml5responsivestatikusseoamp technology,  portfolió készítésdomaintárhelyügyintézésseografikavideo mp4logónévjegykártyaajándék utalványokgoogle analytics, ', '1', null, 'http://hazdoktor.net/', null), ('331', 'Rendek', 'Richárd (ProgieFanBoy)', 'rrfuturedesign@gmail.com', '9dadde791538acfce7a4292d3e2c4e2688b93c2b3deb4bdc74537452454aa210', '6', '1479270919', '2315', 'Szigethalom', 'Fiumei utca 117.', '+36705000134', 'rendek-richard-progiefanboy', '2', null, '7 éve Photoshoppolok, Sony Vegas 