ult logok készítéséhez, de a Photoshop sem ismeretlen számomra. Marketing e-mail designokat is szívesen tervezek, vagy akár szövegezéssel együtt is szállítok.\n\nJelenleg a Bosman ICT Services holland vállalatnál vállalok angol nyelvű szövegírói munkákat (több más kisebb ügyfél mellett), és ügyfélkörömet szeretném tovább bővíteni.', 'szabaduszok-szuhanszki-ruben-pic.jpg', 'szabaduszok-szuhanszki-ruben-pic-list.jpg', null, '0', null, '2016-12-02 20:46:00', '2016-12-05 13:52:00', '0', '0', '0.00', '1', '0', 'Szuhánszki Ruben Üdv!\n\nAzért találkoztunk itt, mert nem szeretném többé szétválasztani a munkát és a szórakozást. Úgy döntöttem, teljes munkaidős szabadúszó leszek, hogy olyannal foglalkohassak, ami valóban érdekel.\nMindent megteszek annak érdekében, hogy minőségi munkát nyújtsak a következőkben:\n\n1. Magyar-Angol, Angol-Magyar fordítás. Diplomát szereztem Angol nyelv és irodalomból, fordítói specializációval. Egy rövid ideig fordító/tolmácsként dolgoztam a Bosch Magyarországnál. Hobbiból pedig amilyen gyakran csak lehet, fordítok a mai napig.\n\n2. Angol nyelvű szöveg, copy, content, vagy akár dalszövegírás. Hobbiként kezdtem el dalszövegeket gyártani több mint tíz éve, nem rég pedig úgy döntöttem, hogy belevágok, és megpróbálkozom a Copywriter szakmával. Jelenleg több cégnek is szállítok rendszeresen rövidebb-hosszabb szövegeket, cikkeket, blogposztokat. Ezen kívül, egy zenei diplomával is rendelkezem (klasszikus-nagybőgő), így kiváltképp közel állnak hozzám a zenével kapcsolatos munkák (zeneszerzés, hangfelvételek stb.)\n\n3. Folyamatosan fejlesztem magam a dizájn terén is. Jelenleg főként az Illustrator programot használom, egyszerű, letisztult logok készítéséhez, de a Photoshop sem ismeretlen számomra. Marketing e-mail designokat is szívesen tervezek, vagy akár szövegezéssel együtt is szállítok.\n\nJelenleg a Bosman ICT Services holland vállalatnál vállalok angol nyelvű szövegírói munkákat (több más kisebb ügyfél mellett), és ügyfélkörömet szeretném tovább bővíteni. 2016-12-02 Zwolle  InformatikaMarketingMédia, PRMenedzsment,  copywriterBloggercontent marketingLanding-pagedesignerOnline marketingfordítás,  logo designangol tudásszövegírásenglish copywritinge-mail marketingadobe illustratortradosmemsourcememoqprojektmenedzsmentadobe photoshopdalszöveg írászeneszerzés, ', '1', null, 'http://naeztnem.hu', '34119fae1a6fb4c698a4f38c205643c520386a9e6f6de113d7fbafd17399d97b'), ('418', 'Orbán', 'Gergely', 'orban.gergely87@gmail.com', '2e35a1c90922cb9ad4d506e451dbcf2dd442a3fd8b022936f0a3f410d034d047', '1', '1480708730', '1221', 'Budapest', '', null, 'orban-gergely', '1', '1500.00', 'Orbán Gergely\ncím: 1221 Péter Pál utca 41.\nMobil: +3670/389-66-27\nE-mail: orban.gergely87@gmail.com\nÁllampolgárság: magyar\nSzül.idő: 1987, 07. 29.\nTanulmányok:\n2000 – 2006 - érettségi - Budai Nagy Antal gimnázium\n2005 – Angol – nyelvvizsga (középfokú) – TIT/TELC\n2003-2007 – színész/rendező képzés - Harsányi Gábor Színművészeti Studió\n2009-2010 – felsőfokú szakképzés– Média, Film/Televizió szak  - Cambridge Regional College \n2009-2010 – intézményi kommunikátor szak – Szegedi Tudományi Egyetem \n2011 – operatőr, vágó tanfolyam - Budavári Schönherz Stúdió \n\nSzakmai tapasztalataim:\n\n2003 - színész, rendező - Harsányi Gábor Színművészeti Studió\n2004 - műsorszerkesztő - Budai TV\n2007 - Színész, Színházirendező, darabíró - Szegedi Mini-színház \n2012 – (gyakornok) stúdiórendező, operatőr, élő műsor kamera rendező - Karma TV\n2013 – marketingvezető, rendező, reklámszínész  – YouTubeTV.ch\n2013 – sorozatszínész – RTL Klub – Barátok Közt\n2013 –vágó– TV2 - Constantin Entertainment – Több, mint testőr\n2013 – vágó – TV2 – Navigator Films\n2013 – 2014 – vágó, szerkesztő, riporter - Magyar Állami Operaház  \n2013 – 2014 - műsorvezető, rendező, riporter, vágó, operatőr – Neo World TV\n2013 – 2015 – stand up comedy előadó – Bethlen Téri Színház\n2014 -  nemzetközi, élő sugárzású, televíziós kamera rendező - Telemedia Interaktv\n2014-  (jelenleg