met, így lehetővé téve, hogy azt csináljak amit szeretek: lakótereket alkothatok sok kreativitással, ámde funkcionálisan, és mérnöki hozzáállással. Van egy saját airbnb-s lakásom, így ebben a témában is jó vagyok, szeretek kiadásra szánt kicsi lakásokat is tervezni. Az egyetem alatt két építészirodában dolgoztam, innen is tanultam jópár dolgot, de a legtöbb tanítást az egyetem mellett a saját tapasztalataim adják. Jól bánok az építkezésen a szakikkal, mert pontosan tudom milyen a munka amit végeznek, mert már túl vagyok 3 sajtát lakásátalakításon, amelyen nem riadtunk meg a kétkezi munkától :)', 'szabaduszok-juhasz-janka-pic.jpg', 'szabaduszok-juhasz-janka-pic-list.jpg', null, '0', null, '2016-12-14 12:43:00', '2016-12-14 12:46:00', '0', '0', '0.00', '1', '0', 'Juhász Janka 2015-ben végeztem a BME építészmérnöki karán. Már az egyetem éveiben elkezdtem lakásátalakításokat tervezni, és ezt csinálom a mai napig. Az első saját munkám megtetszett  pár embernek, ők lettek az első ügyfeleim. Majd szépen sorban továbbadták a nevemet, így lehetővé téve, hogy azt csináljak amit szeretek: lakótereket alkothatok sok kreativitással, ámde funkcionálisan, és mérnöki hozzáállással. Van egy saját airbnb-s lakásom, így ebben a témában is jó vagyok, szeretek kiadásra szánt kicsi lakásokat is tervezni. Az egyetem alatt két építészirodában dolgoztam, innen is tanultam jópár dolgot, de a legtöbb tanítást az egyetem mellett a saját tapasztalataim adják. Jól bánok az építkezésen a szakikkal, mert pontosan tudom milyen a munka amit végeznek, mert már túl vagyok 3 sajtát lakásátalakításon, amelyen nem riadtunk meg a kétkezi munkától :) 2016-12-14 Budapest  Ipar,  belsőépítészetépítészetlátványtervezésgrafika,  archicadphotoshopcinema4dépületfelmérésTervezés, ', '1', null, 'http://juhaszjanka.com/', '78e8d70da76313584a4c903c79a2ec99afb512cd392e837fa5746e9f9a35376e'), ('479', 'Czakó', 'Gábor', 'cetka@ecce.hu', '5b206dc1898d4e2ec0f53a12091e8138ba2e5967c64321554ac2f2b9746e74b5', '1', '1481720180